  },
  formControlDoubleRadio: {
    margin: theme.spacing.unit * 1,
    marginTop: theme.spacing.unit * 2,
  },
  group: {
    marginTop: theme.spacing.unit * 1,
  },
  dense: {
    marginTop: 19,
  },
  menu: {
    width: 200,
  },
  fontLabel:{
    fontWeight:'bold',
  },
  fontSwitch:{
    fontFamily:'Roboto Slab',
    fontSize:30,
    color:'#025c'
  },
  fontInput:{
    fontWeight:'bold',
  }
});

const currencies = [
  {
    value: 'USD',
    label: 'MG',
  },
  {
    value: 'EUR',
    label: 'PI',
  },
  {
    value: 'BTC',
    label: 'BA',
  },
  {
    value: 'JPY',
    label: 'RO',
  },
];
function TextMaskCustom(props) {

  return (
    <MaskedInput
      mask={['(', /[0-9]/, /\d/, /\d/, ')', ' ', /\d/, /\d/, /\d/, /\d/, /\d/, '-', /\d/, /\d/, /\d/, /\d/]}
      placeholderChar={'\u2000'}
      showMask
    />
