  state = {
    numeroresponsavel: '(086)9    -    ',

  };

  render() {
    return (
      <div>
      <Typography component="div">
      <Box fontWeight={1000} textAlign='center' fontSize={45} fontFamily='Roboto Slab' style={{color:'#025c'}} m={1}>
        {this.props.h1first}

      </Box>
      <Box textAlign="left" m={1}>
       Mensagem
      </Box>
    </Typography>
      <div style={{alignSelf: 'stretch',
    textAlign: 'center',}}>
        <DataTable />
        <DataTable />
        <DataTable />
        <DataTable />
        <DataTable />
        <DataTable />
        <DataTable />
        <DataTable />
        <DataTable />
        <DataTable />
